import React from 'react';

function Food(fav){
  return <h1>I am a {fav}</h1>;
}

function App() {
  return (
    <div>
      <h1>Hello!</h1>
      <Food fav = "kimchi" />
      <Food fav = "ramyeon" />
      <Food fav = "coffee" />
    </div>
  );
}

export default App;
